INSERT INTO `v1_ff721e1cd1e602ef4430c30c61ccf25eb3c0757a26b154e7bfaf9c04c63af847` VALUES (0.625, 0.75, "ツムギのボトルキャップ", 1, 6, 11601, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。");
